import React from "react";

export const Table = ({drgns}) => {
    return ( 
        <div>
            <table>
                <tr>
                    <th>Attribute</th>
                    {drgns.map((dragon) => (
                        <th>{dragon.name}</th>

                    ))}
                </tr>
                <tr>
                    <th>Name</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.name}</td>
                    ))}
                </tr>
                <tr>
                    <th>Type</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.type}</td>
                    ))}
                </tr>
                <tr>
                    <th>Habitat</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.habitat}</td>
                    ))}
                </tr>
                <tr>
                    <th>Trainable</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.trainable.toString()}</td>
                    ))}
                </tr>
                <tr>
                    <th>Attack</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.atk}</td>
                    ))}
                </tr>
                <tr>
                    <th>Speed</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.speed}</td>
                    ))}
                </tr>
                <tr>
                    <th>Armor</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.armor}</td>
                    ))}
                </tr>
                <tr>
                    <th>Firepower</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.firepower}</td>
                    ))}
                </tr>
                <tr>
                    <th>Shot Limit</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.shotlimit}</td>
                    ))}
                </tr>
                <tr>
                    <th>Venom</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.venom}</td>
                    ))}
                </tr>
                <tr>
                    <th>Jaw Strength</th>
                    {drgns.map((dragon, index) => (
                        <td key={index}>{dragon.jawstrength}</td>
                    ))}
                </tr>
                <tr>
                    <th>Stealth</th>
                    {drgns.map((dragon) => (
                        <td>{dragon.stealth}</td>
                    ))}
                </tr>
            </table>
        </div>
    );
}
